import React from 'react';
import { Link } from 'react-router-dom';

function AcademicsPopup() {
  const academics = [
    {
      name: 'Programs',
      links: [
        { name: 'Undergraduate', link: '/undergraduate' },
        { name: 'Postgraduate', link: '/postgraduate' },
        // ... more links
      ]
    },
    {
      name: '. . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . . .',
      links: [
        { name: 'Academic Calendar', link: '/academic-calendar' },
        { name: 'Directorate of Continuing Education', link: '/director-continuing-education' },
        // ... more links
      ]
    },
    // ... other academic sections
  ];

  return (
    <div className="custom-popup">
      {academics.map((section, index) => (
        <div key={index}>
          <h3 className="title-name">{section.name}</h3>
          <ul>
            {section.links.map((linkItem, linkIndex) => (
              <li key={linkIndex}>
                <Link to={linkItem.link} className="small-text">{linkItem.name}</Link>
              </li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
}

export default AcademicsPopup;
